import React from 'react';
import FileUpload from './FileUpload';
import ImageUploader from './ImageUploader';
import './Animator.css';
import FeatureList from './FeatureList';


function Animator() {
  return (
    <div className="AnimatorFrame">
        <h1>Animator</h1>
        <ImageUploader />
        <FeatureList />
    </div>
  )
}

export default Animator
